import React from 'react';
import "./SaginawCards.css";

function SaginawCard( { card }) {

    return (
        <div className="SaginawCard" tabindex="0">
        {card.image}
        <div className="overlay">
          <div>
            <div id="p1title" className="title">{card.description}</div>
          </div>
     </div>
     </div>
    )


}

export default SaginawCard;
